sources.app/views/writings.js:
export default class Writings extends Component {
  show() {
    return (
      <writing>
        <line>
          Either write something worth reading or do something worth writing.
          <b>- Benjamin Franklin</b>
        </line>
        <br />
        Off doing things. Check back.
      </writing>
    )
  }

  styles = {
    writing: {
      marginTop: 20,
    },
    line: {
      display: "block",
    },
    b: {
      display: "inline",
      marginLeft: 3,
    },
  }
}
